import React from "react";
import { NavLink } from "react-router-dom";


const Navbar = () => {
    return (
      <>
     <div className="home">
     <div className="row">
     <div className="col12 col-auto pad0">
     <div className="row d-flex relative">
     <div className="col3 pad10-15 button-flex t-w50" on="tap: AMP.setState({dropdown: !dropdown })" role="button" tabindex="false">
     <div>
        
       </div>
    
       <div className="col9 d-flex pad10-15" id="navTarg" style="">
      
       </div>
       <div className="responisve_menu_button">
        <button on="tap:mibile_menu.toggle" className="nav_button hamburger navigation_wrapper">
          <span></span>
          <span></span>
          <span></span>
        </button>
      </div>
      </div> 
     </div> 
     </div>
     </div>
     </div>
    </>
     );
};
export default Navbar;
